import "./styles.css";
import "./App.css";
import React, { useState } from 'react'
import { render } from 'react-dom'
import { BrowserRouter as Router, Routes, Route }
    from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Table from 'react-bootstrap/Table';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import PropTypes from 'prop-types';

function HeaderMenu() {
  return (
    <Navbar expand="lg" className="bg-pink" >
      <Container>
        <Navbar.Brand href="#home">Organizer</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <NavDropdown title="Websites" id="basic-nav-dropdown">
              <NavDropdown.Item href="https://blackboard.sc.edu/ultra/course">Blackboard</NavDropdown.Item>
              <NavDropdown.Item href="https://dropbox.cse.sc.edu/login/index.php">Dropbox</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="https://calendar.google.com/calendar/u/0/r/week/2023/10/8">Google Calendar</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="https://capstone.cse.sc.edu/milestone/research/#deliverables">Capstone</NavDropdown.Item>
              <NavDropdown.Item href="https://cse.sc.edu/~shephejj/csce552/">Game Development</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

function Capstone() {
  return (
    <a href="https://capstone.cse.sc.edu/milestone/source-control/" target="_blank">
    <button style = {{color: 'white', fontSize: '20px', background: 'gray'}}>
      Capstone
    </button>
    </a>
  );
}

export default function App() {
  return (
    <div className="App">
      <h1>Hello Capstone</h1>
      <h2>Here is my codebase!</h2>
      <h2>Here is another commit</h2>
      <h2>Here is a link to the Capstone website</h2>
      <h2 style={{textAlign: 'center'}}><Capstone/></h2>
    </div>
  );
}
